  distanceTable = function(refWord, data, metric) {
    var nr, roundedDistance, row, wordsList;
    wordsList = $('<table class="table table-condensed table-striped">');
    wordsList.append("<tr><th>" + refWord + "</th><th>" + metric + "</th></tr>");
    for (nr in data) {
      row = data[nr];
      roundedDistance = Math.round(row[1] * 10000, 4) / 10000;
      wordsList.append("<tr><td>" + row[0] + "</td><td>" + roundedDistance + "</td></tr>");
    }
    return wordsList;
  };

